css:
.highlight.linter-warning .region {
  background: linear-gradient(to bottom, #ff9a27 0%, rgba(255, 154, 39, 0.30000000000000004) 20%, rgba(255, 154, 39, 0.30000000000000004) 80%, #ff9a27 100%);
  border-left: 2px solid #ff9a27;
  border-right: 2px solid #ff9a27;
}
.highlight.linter-error .region {
  background: linear-gradient(to bottom, #ee521a 0%, rgba(238, 82, 26, 0.30000000000000004) 20%, rgba(238, 82, 26, 0.30000000000000004) 80%, #ee521a 100%);
  border-left: 2px solid #ee521a;
  border-right: 2px solid #ee521a;
}
